%[text] %[text:anchor:T_2C114E57] # **Scatter Fit Chart Examples**
%[text] **Overview**
%[text] The `ScatterFitChart` manages bivariate scattered data together with the associated best-fit trend line (regression line). The chart data comprises numeric vectors `XData` and `YData`. The `YData` is scattered against the `XData` and the best-fit line is computed using the `fitlm` function to perform linear regression.
%[text] ![ScatterFitChart.png](text:image:0dcd)
%[text] **Documentation**
%[text] - [`scatter`](<matlab: doc( "scatter" )>): create a scatter plot with variable marker color and size
%[text] - [`fitlm`](<matlab: doc( "fitlm" )>): fit a linear regression model \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_8B91939F] ## Create sample x and y data for the chart.
rng( "default" )
x = randn( 1000, 1 );
y = 2 * x + 1 + 2 * randn( size( x ) );
%%
%[text] %[text:anchor:H_2C35D441] ## Create a figure for the chart.
f = exampleFigure( "Name", "ScatterFitChart Example" ); %[output:9aea6c0f]
%%
%[text] %[text:anchor:H_933A2EDD] ## Create the chart.
SFC = ScatterFitChart( "Parent", f, ...     %[output:group:86c57b78] %[output:9aea6c0f]
    "XData", x, ... %[output:9aea6c0f]
    "YData", y ); %[output:group:86c57b78] %[output:9aea6c0f]
%%
%[text] %[text:anchor:H_CF114B63] ## Annotate the chart.
xlabel( SFC, "x-data", "FontSize", 14 ) %[output:031cbbab]
ylabel( SFC, "y-data", "FontSize", 14 ) %[output:031cbbab]
title( SFC, "2D Scatter Plot with Fit", "FontSize", 14 ) %[output:031cbbab]
grid( SFC, "on" ) %[output:031cbbab]
legend( SFC, "Location", "northwest" ); %[output:031cbbab]
%%
%[text] %[text:anchor:H_BEDD463F] ## Customize the chart by adjusting its graphics properties.
SFC.LineColor = [1, 0.5, 0]; %[output:402a6ece]
SFC.LineWidth = 3; %[output:402a6ece]
SFC.CData = [0, 0.5, 0.5]; %[output:402a6ece]
SFC.SizeData = 100; %[output:402a6ece]
SFC.Controls = "off"; %[output:402a6ece]
%%
%[text] %[text:anchor:H_836F99B8] ## Update the chart data.
SFC.XData = randn( 750, 1 ); %[output:1fde0866]
SFC.YData = (-1) * SFC.XData + 2 + 2 * randn( size( SFC.XData ) ); %[output:1fde0866]
%%
